import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Test.css'

class Test extends Component {

    render() {
      const { error, isLoaded} = this.state;
      if (error) {
        return <div>{console.log(error.message)}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <div className="body">
             hello wold!!
          </div>
        );
      }
    }
  }
  export default Test
